import React from 'react';
import './App.css';
import {BrowserRouter,Route,Routes} from 'react-router-dom';
import EmpListing from 'em'

function App() {
    return(
        <div className="App">
            <h1>React Js CRUD Operations</h1>
        </div>
    );
    <BrowserRouter>
        <Routes>
            <Route path="/" element={<EmpListing />}></Route>
        </Routes>
    </BrowserRouter>
}

export default App;
